CREATE TABLE personage(
	id TEXT PRIMARY KEY,
	name TEXT,
    description TEXT,
    description1 TEXT,
    attack1 TEXT,
    descriptionattack1 TEXT,
    mpattack1 TEXT,
    attack2 TEXT,
    descriptionattack2 TEXT,
    mpattack2 TEXT,
    attack3 TEXT,
    descriptionattack3 TEXT,
    mpattack3 TEXT,
    hp TEXT,
    mp TEXT,
    atk TEXT,
    matk TEXT,
    def TEXT,
    mdef TEXT,
    crit TEXT,
    spd TEXT
	
);


UPDATE "public"."personage" SET "name" = 'Kirito', "description" = '[L’égaré de Vector]', "description1" = 'Il s’agit d’un garçon qui s’est réveillé dans le monde virtuel « Underworld (UW) ». Il a gardé sa conscience et ses souvenirs du monde réel qui devaient être bloqués à l’origine lors de la plongée, mais il ne se souvient pas des événements qui se sont produits juste avant son arrivée dans ce monde. Il a remarqué que les habitants de l’Underworld ne sont ni des humains, ni des IA. C’est pour cette raison qu’il souhaite se rendre à Centoria, la Capitale Centrale, afin de pouvoir identifier sa mission.', "attack1" = 'Horizontal A', "descriptionattack1" = 'Attaque tranchante sur tous les ennemis (forte).', "mpattack1" = '32', "attack2" = 'Vertical Arc B', "descriptionattack2" = 'ss', "mpattack2" = '18', "attack3" = 'Sharp Nail (Volonté)', "descriptionattack3" = 'ss', "mpattack3" = '??', "hp" = '3023', "mp" = '189', "atk" = '1414', "matk" = '1336', "def" = '744', "mdef" = '744', "crit" = '420', "spd" = '267' WHERE "id" = '1';
UPDATE "public"."personage" SET "name" = 'Eugeo', "description" = '[L’entailleur du Gigas Cedar]', "description1" = 'Il s’agit d’un habitant de Rulid dans l’UW. Il lui a été attribué la tâche sacrée d’entailleur. Il doit frapper de sa hache 2 000 fois par jour le Gigas Cedar, un gigantesque arbre noir. C’est la première personne que Kirito a rencontrée dans ce monde et ils sont restés ensemble depuis. Il regrette toujours de ne pas avoir pu aider son amie d’enfance Alice, qui a été enlevée par un Chevalier de l’Intégrité lorsqu’ils étaient plus jeunes.', "attack1" = 'Slant C', "descriptionattack1" = 'Attaque tranchante sur un ennemi (faible). Charge la Volonté de 15,00%', "mpattack1" = '22', "attack2" = 'Heal Durability', "descriptionattack2" = 'Soins HP sur un allié (forte).', "mpattack2" = '21', "attack3" = 'Horizontal Square (Volonté)', "descriptionattack3" = 'Attaque tranchante de Volonté sur tous les ennemis.', "mpattack3" = '??', "hp" = '2720', "mp" = '199', "atk" = '1283', "matk" = '1270', "def" = '799', "mdef" = '768', "crit" = '449', "spd" = '273' WHERE "id" = '2';
UPDATE "public"."personage" SET "name" = 'Alicia', "description" = '[Le Seigneur des Cait Siths]', "description1" = 'Il s’agit d’une joueuse d’ALO. Elle est belle et officie en tant que seigneur Cait Sith. Elle a des oreilles et une queue de chat, et le point fort de sa race est de pouvoir apprivoiser des monstres et des animaux. Elle est extrêmement populaire et est au gouvernement depuis plus longtemps que Sakuya. Elle a comme atout une armée de Chevaliers Dragons sous ses ordres qui n’a même pas été capturée en screenshot.', "attack1" = 'Umbra Ball C', "descriptionattack1" = 'Attaque magique sur un ennemi (faible). Charge la Volonté de 15,00%', "mpattack1" = '22', "attack2" = 'Recover Seal All', "descriptionattack2" = 'Soins HP sur tous les alliés (faible). Guérit des sceaux.', "mpattack2" = '21', "attack3" = 'Umbra Dome (Volonté)', "descriptionattack3" = 'Attaque magique de Volonté sur tous les ennemis.', "mpattack3" = '??', "hp" = '3331', "mp" = '211', "atk" = '1617', "matk" = '1703', "def" = '1020', "mdef" = '1026', "crit" = '503', "spd" = '281' WHERE "id" = '3';
